import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
// Import AuthProvider as a named export
import { AuthProvider } from './context/AuthContext';

ReactDOM.render(
  <AuthProvider>
    <App />
  </AuthProvider>,
  document.getElementById('root')
);
